(function () {
  // -- Config --
  const BASE64_LOGO = 'data:image/png;base64,';
  const LOGIN_LOGO_WIDTH = '75px';
  const LOGIN_LOGO_HEIGHT = '75px';
  const NAV_LOGO_WIDTH = '30px';
  const NAV_LOGO_HEIGHT = '30px';
  const NAV_BRANDING_ID = 'mpplus-nav-branding';
  const LOGIN_IMG_SELECTOR = 'img.dn.db-ns.pa3.w3.absolute.left-0.top-0';

  // -- Helpers for route checks --
  function isLoginPage() {
    const p = location.pathname || '';
    return /^\/login\/?$/.test(p);
  }
  function isTimelinePage() {
    const p = location.pathname || '';
    return /^\/timeline(\/|$)/.test(p);
  }

  // -- Login: replace matching imgs with base64 (only on /login) --
  function injectLoginBranding() {
    if (!isLoginPage()) return;
    if (!BASE64_LOGO) return; // nothing to do

    try {
      const imgs = document.querySelectorAll(LOGIN_IMG_SELECTOR);
      imgs.forEach(img => {
        try {
          if (img && img.src !== BASE64_LOGO) {
            img.src = BASE64_LOGO;
            img.style.width = LOGIN_LOGO_WIDTH;
            img.style.height = LOGIN_LOGO_HEIGHT;
            console.log("[MP+] Logo replaced and resized (login):", img);
          }
        } catch (e) {
          console.error("[MP+] error replacing logo (login):", e);
        }
      });
    } catch (err) {
      console.error("[MP+] injectBranding error (login):", err);
    }
  }

  // -- Timeline: insert the flex branding inside .nav-header at top (only on /timeline/*) --
  function insertNavHeaderBranding() {
    if (!isTimelinePage()) return;
    if (!BASE64_LOGO) return; // nothing to show

    try {
      // avoid duplicates
      if (document.getElementById(NAV_BRANDING_ID)) return;

      const navHeader = document.querySelector('.nav-header');
      if (!navHeader) return;

      const wrapper = document.createElement('div');
      wrapper.id = NAV_BRANDING_ID;

      const inner = document.createElement('div');
      inner.style.display = 'flex';
      inner.style.alignItems = 'center';

      const img = document.createElement('img');
      img.src = BASE64_LOGO;
      img.style.height = NAV_LOGO_HEIGHT;
      img.style.width = NAV_LOGO_WIDTH;
      img.style.marginRight = '6px';
      img.alt = 'MP+';

      const h3 = document.createElement('h3');
      h3.style.margin = '0';
      h3.style.padding = '0';
      h3.textContent = 'MP+';

      inner.appendChild(img);
      inner.appendChild(h3);
      wrapper.appendChild(inner);

      // insert at top of navHeader
      navHeader.insertBefore(wrapper, navHeader.firstChild);
      console.log("[MP+] Nav branding inserted (timeline).");
    } catch (err) {
      console.error("[MP+] insertNavHeaderBranding error:", err);
    }
    window.mpplus.fetchStudentLevel();
  }

  // -- Central handler for route/DOM changes --
  let _debounceTimer = null;
  function handleRouteChangeDebounced() {
    if (_debounceTimer) clearTimeout(_debounceTimer);
    _debounceTimer = setTimeout(() => {
      try {
        // run only the things relevant to current route
        injectLoginBranding();       // will no-op if not /login
        insertNavHeaderBranding();   // will no-op if not /timeline/*
      } catch (e) {
        console.error("[MP+] handleRouteChange error:", e);
      }
    }, 50);
  }

  // -- Hook into history API so single-page navs trigger our handler --
  function hookHistoryEvents() {
    const _push = history.pushState;
    const _replace = history.replaceState;

    history.pushState = function (...args) {
      _push.apply(this, args);
      // slight delay to allow SPA routing to update DOM
      setTimeout(handleRouteChangeDebounced, 50);
      return undefined;
    };

    history.replaceState = function (...args) {
      _replace.apply(this, args);
      setTimeout(handleRouteChangeDebounced, 50);
      return undefined;
    };

    window.addEventListener('popstate', () => setTimeout(handleRouteChangeDebounced, 50));
  }

  // -- Mutation observer to catch DOM changes that might add the elements we want --
  function setupMutationObserver() {
    const obs = new MutationObserver(() => {
      handleRouteChangeDebounced();
    });

    try {
      obs.observe(document.documentElement, { childList: true, subtree: true });
    } catch (e) {
      // sometimes observe fails if DOM not ready; try again shortly
      setTimeout(() => {
        try { obs.observe(document.documentElement, { childList: true, subtree: true }); } catch (e) {}
      }, 200);
    }
  }

  // -- Init --
  function init() {
    // Run once now for initial load
    handleRouteChangeDebounced();
    // Keep listening for SPA route changes / dom changes
    hookHistoryEvents();
    setupMutationObserver();
  }

  if (document.readyState === 'loading') {
    window.addEventListener('DOMContentLoaded', init, { once: true });
  } else {
    init();
  }
})();